import { Box, Heading, Text } from '@primer/react'

export function SelectHeader() {
    return (
        <Box>
            <Heading
                as="h1"
                sx={{
                    fontSize: '4',
                }}
            >
                All Usage
            </Heading>
            <Text
                sx={{
                    color: 'fg.muted',
                }}
            >
                Hey
            </Text>
        </Box>
    )
}
